<body style="--card-image: rgba(1, 26, 248, 0.2); --blur: 0px; --brightness: 1; --interactable: all; --modal-margin: 10vh; --scale: 1.1; --modal-width: 60vw; --modal-height: 65vh">
    <div id="preloader">
        <div style="width: 70%;">
            <img src="imgs/глобус.gif" alt="глобус" />
            <h3>Россия</h3>
            <br />
            <p id="fact">Загрузка.</p>
        </div>
    </div>
    <marquee id="pc" behavior="alternative" direction="left" style="font-size: 1.3em;">Сделал Бордунов Сергей</marquee>
    <div id="modal">
        <div class="modal-content">
            <div style="">
                <span id="close">&times;</span>
                <h2 class="center">Информация</h2>
            </div>
            <br />
            <div id="bigFlex">
                <img src="imgs/map/1_.png" alt="" id="modal-img">
                <div id="modal-info" style="font-family: 'Panton'">
                    <p>Название: </p>
                    <p>Инфа</p>
                    <p id="interFact"></p>
                    <button id="showOnMap"><a href="#" target="_blank">Показать на яндекс картах</a></button>
                    <br>
                </div>
            </div>
            <br />
            <div id="dostBg">
                <h3 id="dostText"><b>Достопримечательности:</b></h3>
                <p id="dost"></p>
            </div>
        </div>
    </div>
    <div id="modal2">
        <div class="modal-content-2">
            <!-- In work for now -->
            <div class="bg" style="display: none;">
                <div style="position: relative;">
                    <img style="left: var(--left-0)" src="imgs/icons/atlas.png" alt="" />
                    <img style="left: var(--left-1)" src="imgs/icons/geography-2.png" alt="" />
                    <img style="left: var(--left-2)" src="imgs/icons/russia.png" alt="" />
                </div>
            </div>
            <div id="defaultInfo">
                <div class="close2">&times;</div>
                <h3 class="center" style="font-size: 25px;">Информация</h3>
                <br />
                <p></p>
                <button id="startTest" style="font-size: 15px;">Начать</button>
            </div>
            <div id="questionInfo" class="hidden">
                <div class="close2">&times;</div>
                <div class="flex">
                    <p id="answerStreak">1/1</p>
                    <h3 id="questionTitle">Вопрос</h3>
                </div>
                <!-- <br /> -->
                <div id="points" class="flex">
                    <div class="point current"></div>
                    <div class="point"></div>
                    <div class="point"></div>
                    <div class="point"></div>
                    <div class="point"></div>
                </div>
                <br />
                <fform action="">
                    <div>
                        <input type="radio" name="choice" id="opt1" value="0">
                        <label for="opt1" id="opt1l">Option 1</label>
                    </div>
                    <div>
                        <input type="radio" name="choice" id="opt2" value="1">
                        <label for="opt2" id="opt2l">Option 2</label>
                    </div>
                    <div>
                        <input type="radio" name="choice" id="opt3" value="2">
                        <label for="opt3" id="opt3l">Option 3</label>
                    </div>
                    <!-- <button id="answerBtn">Проверить</button> -->
                    <!-- <h4 id="status">Статус: ...</h4> -->
                    <div id="btns" class="flex">
                        <button id="previousBtn" style="font-size: 16px;" disabled>Предедущий</button>
                        <button id="nextBtn" style="font-size: 16px;">Дальше</button>
                        <div style="flex-grow: 0.97; position: relative">
                            <button disabled id="summitBtn" style="font-size: 16px; position: absolute; right: 0">Итоги</button>
                        </div>
                    </div>
                </fform>
            </div>
            <div id="summit" class="hidden">
                <div class="close2">&times;</div>
                <h3>Итоги</h3>
                <div id="myChartContainer">
                    <canvas id="myChart" role="img" aria-label="My chart"></canvas>
                </div>
                <h3 id="grade"><b>Оценка: </b></h3>
            </div>
        </div>
    </div>
